import React, { useState, useEffect } from "react";
import Styles from "./FindPeople.module.css";
import AvatarCollection from "./AvatarCollection/AvatarCollection";
import { Carousel } from "react-bootstrap";
import MyModal from "../../MyModal/MyModal";
export default function FindPeople() {
	const [open, setOpen] = useState(false);

	const handleClick = () => {
		setOpen(true);
		console.log("click");
	};

	const handleClose = () => {
		setOpen(false);
	};
	return (
		<div className={Styles.container}>
			<h3 className={Styles.heading}>De personas a las que sigues</h3>
			<div className={Styles.innerContainer}>
				<Carousel onClick={handleClick} indicators={false}>
					<Carousel.Item>
						<div style={{ display: "flex" }}>
							<AvatarCollection amount={7}></AvatarCollection>
						</div>
					</Carousel.Item>
					<Carousel.Item>
						<div style={{ display: "flex" }}>
							<AvatarCollection amount={7}></AvatarCollection>
						</div>
					</Carousel.Item>
				</Carousel>

				<button className={Styles.Button}>
					Encuentra a personas que seguir
				</button>
			</div>
			<MyModal open={open} handleClose={handleClose}></MyModal>
		</div>
	);
}
